goog.provide("goog.fx.easingTest");goog.setTestOnly("goog.fx.easingTest");goog.require("goog.fx.easing");goog.require("goog.testing.jsunit");function testEaseIn(){assertEquals(0,goog.fx.easing.easeIn(0));assertEquals(1,goog.fx.easing.easeIn(1));assertRoughlyEquals(0.125,goog.fx.easing.easeIn(.5),.01)}function testEaseOut(){assertEquals(0,goog.fx.easing.easeOut(0));assertEquals(1,goog.fx.easing.easeOut(1));assertRoughlyEquals(1-0.125,goog.fx.easing.easeOut(.5),.01)}